import React from 'react'
import "../../assets/css/sidemenu.css";

const AllQuestions = () => {
  return (
    <div className='allQuestions'>
        <div className='d-flex justify-content-between ms-4 me-5'>
            <h3>All Questions</h3>
            <button className='query ps-3 pe-3 rounded-2'>Ask Query</button>
        </div>
        <div className='ms-4'>
            <p>23,870,0227 questions</p>
        </div>
    </div>
  )
}

export default AllQuestions
